module.exports = function (comparator) {
  return function (input) {
    var output = [];

    for (var ii = 0, count = input.length; ii < count; ii++) {
      var found = false;

      for (var jj = output.length; jj--;) {
        found = found || comparator(input[ii], output[jj]);
      }

      if (found) {
        continue;
      }

      output[output.length] = input[ii];
    }

    return output;
  };
};
